var msgobj = tempVars("msgobj")
var nitro = ["USER_PREMIUM_GUILD_SUBSCRIPTION", "USER_PREMIUM_GUILD_SUBSCRIPTION_TIER_1", "USER_PREMIUM_GUILD_SUBSCRIPTION_TIER_2", "USER_PREMIUM_GUILD_SUBSCRIPTION_TIER_3"]
var type = nitro.findIndex((a) => a === msgobj.type);
if (type != -1) {
  var server = this.getServer("",0,cache);
  var Nitro = {}
  Nitro.Count = server.premiumSubscriptionCount;
  Nitro.Tier = server.premiumTier;
  Nitro.member = msgobj.author;
  this.storeValue(Nitro,1,"Nitro",cache);
  this.callNextAction(cache);
}

var memberobj = tempVars("memberobj")
memberobj.guild.fetchInvites().then(guildInvites => {
  var invites = globalVars("invites")
  var invite = guildInvites.find(function(invite1) {
    return invites[memberobj.guild.id].find(i => i.uses < invite1.uses)
  })
  var code = invite.code
  var inviter = cache.server.members.find(member => member.id === invite.inviter.id)
  invites[cache.server.id] = guildInvites
  this.storeValue(invites,3,"invites",cache)
  while (typeof code === "undefined" && typeof inviter === "undefined") {
    var code = invite.code
    var inviter = cache.server.members.find(member => member.id === invite.inviter.id)
  }
  this.storeValue(inviter,1,"inviter",cache)
  this.storeValue(code,1,"code",cache)
  this.callNextAction(cache)
})

var run = globalVars("run")
if ((typeof run === "undefined" || run != "1") == true) {
  this.storeValue("1",3,"run",cache)
  var botclient = this.getDBM().Bot.bot.guilds
  var invites = {}
  botclient.forEach(g => {
    g.fetchInvites().then(guildInvites => {
      invites[g.id] = guildInvites
    })
  })
  this.storeValue(invites,3,"invites",cache)
